import React, { useState } from 'react';
import './Category.css';

const CategoryCarousel = ({ title, category }) => {
  // States to manage the current set of images and enrollment info
  const [currentIndex, setCurrentIndex] = useState(0);
  const [enrolled, setEnrolled] = useState(null);  // Track the enrollment status for each item

  // Function to go to the next set of images
  const goToNext = () => {
    if (currentIndex + 4 < category.length) {
      setCurrentIndex(currentIndex + 4);
    }
  };

  // Function to go to the previous set of images
  const goToPrev = () => {
    if (currentIndex - 4 >= 0) {
      setCurrentIndex(currentIndex - 4);
    }
  };

  // Handle enroll action
  const handleEnroll = (index) => {
    const enrollmentDate = new Date().toLocaleDateString(); // Get today's date
    setEnrolled({ index, date: enrollmentDate });
  };

  // Render category items for the current set of images
  const renderCategoryItems = (items) => {
    return items.map((item, index) => (
      <div className="category-item" key={index}>
        <img src={item.image} alt={item.title} className="category-image" />
        <h4>{item.title}</h4>
        <p>{item.description}</p>
        <button 
          className="enroll-btn" 
          onClick={() => handleEnroll(currentIndex + index)} // Pass the current index of the item
        >
          Enroll Now
        </button>
        {enrolled && enrolled.index === currentIndex + index && (
          <p className="enrollment-message">
            <p>
            Enrolled Successfully .
            </p>
          </p>
        )}
      </div>
    ));
  };

  return (
    <div className="category-section">
      <h3 className="category-title">{title}</h3>
      <div className="category-carousel">
        <button className="carousel-btn prev-btn" onClick={goToPrev}>
          ◄
        </button>
        <div className="carousel-content">
          <div className="category-row">
            {renderCategoryItems(category.slice(currentIndex, currentIndex + 4))}
          </div>
        </div>
        <button className="carousel-btn next-btn" onClick={goToNext}>
          ►
        </button>
      </div>
    </div>
  );
};

const Category = () => {
  const freeWorkout = [
    { image: '/images/free1.jpg', title: 'Beginner Full Body Workout', description: 'Start your fitness journey with a full-body workout designed for beginners. Build strength, endurance, and flexibility.' },
    { image: '/images/free2.jpg', title: 'Cardio Blast', description: 'Boost your heart health and burn calories with high-energy cardio exercises in this dynamic workout.' },
    { image: '/images/free3.jpg', title: 'Core Strength Challenge', description: 'Focus on strengthening your core with targeted exercises that improve stability and posture.' },
    { image: '/images/free4.jpg', title: 'Bodyweight HIIT', description: 'Burn fat fast with high-intensity interval training using just your body weight for maximum results.' },
    { image: '/images/free5.png', title: 'Full Body Stretching Routine', description: 'Improve flexibility and mobility with a full-body stretching routine that targets every major muscle group.' },
    { image: '/images/free6.jpg', title: 'Morning Yoga Flow', description: 'Start your day right with a gentle yoga flow that helps with flexibility, relaxation, and mindfulness.' },
    { image: '/images/free7.jpg', title: 'Leg Day Essentials', description: 'Build strong legs and glutes with a collection of exercises that focus on your lower body strength.' },
    { image: '/images/free8.jpg', title: 'Jump Rope Fitness', description: 'Get your heart pumping with jump rope exercises that improve cardiovascular health and coordination.' }
  ];

  const paidWorkout = [
    { image: '/images/c1.jpg', title: 'Strength Training Program', description: 'Gain muscle mass and increase strength with a premium strength training program designed for all levels.' },
    { image: '/images/c2.jpg', title: 'Advanced CrossFit Routine', description: 'Push your limits with a challenging CrossFit routine that combines weightlifting and bodyweight exercises.' },
    { image: '/images/c3.jpg', title: 'Workout Plan with Coach', description: 'Get personalized workout plans and one-on-one coaching sessions to help you reach your fitness goals faster.' },
    { image: '/images/c4.jpg', title: 'Full Body Sculpting', description: 'Achieve a toned and sculpted body with exercises that target every muscle group for a balanced workout.' },
    { image: '/images/c5.jpg', title: 'High-Intensity Fat Loss Program', description: 'Kickstart your fat loss journey with high-intensity workouts designed to burn fat and improve metabolism.' },
    { image: '/images/c6.jpg', title: 'Bodybuilding for Beginners', description: 'Learn the fundamentals of bodybuilding and start building muscle with this beginner-friendly program.' },
    { image: '/images/c7.jpg', title: 'Powerlifting Routine', description: 'Focus on increasing your strength with a powerlifting program that emphasizes squats, deadlifts, and bench press.' },
    { image: '/images/c8.jpg', title: 'Athletic Conditioning', description: 'Enhance your athletic performance with exercises that improve speed, agility, and power for any sport.' }
  ];

  const workoutWithNutrition = [
    { image: '/images/n1.jpg', title: 'Workout and Nutrition Bundle', description: 'A complete program combining workout plans with expert nutrition guidance for optimal fitness results.' },
    { image: '/images/n2.jpg', title: 'Nutrition-Boosted Training', description: 'Fuel your strength training workouts with a nutrition plan that enhances muscle growth and recovery.' },
    { image: '/images/n3.jpg', title: 'Fat Loss and Nutrition Guide', description: 'Lose fat effectively with a program that includes both high-intensity workouts and a customized nutrition plan.' },
    { image: '/images/n4.jpg', title: 'Muscle Gain and Diet Plan', description: 'Accelerate muscle growth with targeted strength training and a diet plan focused on protein intake and recovery.' },
    { image: '/images/n5.jpeg', title:'Training with Nutrition Support', description: 'Boost your stamina and endurance with a mix of cardio workouts and proper nutrition to fuel your performance.' },
    { image: '/images/n6.jpg', title: 'Athlete Workout Plan', description: 'Train like an athlete with a vegan diet plan that provides the nutrients needed for optimal performance and recovery.' },
    { image: '/images/n7.jpg', title: 'Balanced Diet for Everyday', description: 'Support your fitness routine with a balanced diet that helps maintain energy levels and muscle health.' },
    { image: '/images/n8.jpg', title: 'Keto Fitness Program', description: 'Reach your fitness goals with a keto diet paired with a workout plan that maximizes fat loss while preserving muscle.' }
  ];

  return (
    <div>
      <CategoryCarousel title="Free Workout Plans" category={freeWorkout} />
      <CategoryCarousel title="Paid Workout Plans" category={paidWorkout} />
      <CategoryCarousel title="Workout with Nutrition Guidance" category={workoutWithNutrition} />
    </div>
  );
};

export default Category;
